			<content:encoded><![CDATA[<p>MICROGAMING –∫–∞–∫ –≤—Å–µ–≥–¥–∞ –¥–µ–ª–∞–µ—Ç –≤–µ—Ç–µ—Ä –∏ —Å–ª–æ—Ç TERMINATOR 2 –Ω–µ –∏—Å–∫–ª—é—á–µ–Ω–∏–µ. –ú–æ—ë –∑–Ω–∞–∫–æ–º—Å—Ç–≤–æ —Å —ç—Ç–∏–º —Å–ª–æ—Ç–æ–º –ø—Ä–æ–∏–∑–æ—à–ª–æ –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —è –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–ª –≤–∏–¥–µ–æ –æ–¥–Ω–æ–≥–æ –∏–≥—Ä–æ–∫–∞,—Ç–∞–º –±—ã–ª –∫—Ä—É—Ç–æ–π –∑–∞–Ω–æ—Å –≤ –±–æ–Ω—É—Å–∫–µ, –∏ —è —Ä–µ—à–∏–ª —Ç–æ–∂–µ –∏—Å–ø—ã—Ç–∞—Ç—å —É–¥–∞—á—É,–∏—Å–ø—ã—Ç—ã–≤–∞—Ç—å —Ä–µ—à–∏–ª –≤ –ì–æ–ª–¥—Ñ–∏—à–∫–µ, –∫–∞–∑—è –Ω–∞–¥—ë–∂–Ω–∞—è –≤–æ –≤—Å–µ—Ö –ø–ª–∞–Ω–∞—Ö,–ø—Ä–∞–≤–¥–∞ —Å –æ—Ç–Ω–∞—à—É—Ö–∞–π —É –Ω–∏—Ö –∑–∞–ª—ë—Ç,–æ–Ω–∏ –∑–≤—ë–∑–¥—ã, –∞ –∏–≥—Ä–æ–∫–∏ —Ç–∞–∫, –ø–æ–≥—É–ª—è—Ç—å –ø—Ä–∏—à–ª–∏</p>
