					<description><![CDATA[–ò—Ç–∞–∫ —ç—Ç–æ, –º–æ–π –Ω–∞–∏–ª—é–±–∏–º–µ–π—à–∏–π —Å–ª–æ—Ç –∏–∑ –≤—Å–µ—Ö –≤–æ–æ–±—â–µ, –≤ –¥–∞–Ω–Ω–æ–º —Å–ª–æ—Ç–µ, —è –≤—ã–∏–≥—Ä–∞–ª –Ω–∞–∏–≤–µ—Å–æ–º–µ–π—à—É—é —Å—É–º–º—É –∏–∑ –≤—Å–µ—Ö —Å–≤–æ–∏—Ö –∏–≥—Ä–æ–≤—ã—Ö —Å–µ—Å—Å–∏–π –≤ –æ–Ω–ª–∞–π–Ω –∫–∞–∑–∏–Ω–æ, –Ω–∞—á–Ω—É —Å —Ç–æ–≥–æ —á—Ç–æ –≤–∫—Ä–∞—Ç—Ü–µ –æ–ø–∏—à—É –¥–∞–Ω–Ω—ã–π —Å–ª–æ—Ç, —Å–ª–æ—Ç –∏–º–µ–µ—Ç 243 –ª–∏–Ω–∏–∏ –±–æ–Ω—É—Å–Ω—É—é –∏–≥—Ä—É —É–≤–µ–ª–∏—á–∏–≤–∞—é—â—é—é –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –ª–∏–Ω–∏–π –¥–æ 2048 –Ω–æ –∏–º–µ—é—â—é—é –æ–≥—Ä–æ–º–Ω—ã–π –º–∏–Ω—É—Å, –≤ –Ω–µ–π –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –ø–æ–ª—É—á–∏—Ç—å —Ä–µ—Ç—Ä–∏–≥–µ—Ä, –Ω–æ –µ—Å—Ç—å –≤ –¥–∞–Ω–Ω–æ–π –±–æ–Ω—É—Å–∫–µ —Ñ—É–Ω–∫—Ü–∏—è, –Ω–∞–∑—ã–≤–∞—é—â–∞—è—è—Å—è —Ö–æ—Ç –º–æ–¥ –≤—ã–ø–∞–¥–∞—é—â—é—é —Ä–∞–Ω–¥–æ–º–Ω–æ, —Ç–∞–∫ –∂–µ —Å—Ç–æ–∏—Ç –æ—Ç–º–µ—Ç–∏—Ç—å —Ñ—É–Ω–∫—Ü–∏—é –∫–æ—Ç–æ—Ä–∞—è –Ω–∞–∑—ã–≤–∞–µ—Ç—Å—è —Ç-1000 –≤–∏–∂–Ω, –æ–Ω–∞ —Ç–∞–∫ –∂–µ –∑–∞–ø—É—Å–∫–∞–µ—Ç—Å—è —Ä–∞–Ω–¥–æ–º–Ω–æ, –≤ –æ–±—ã—á–Ω–æ–π –∏–≥—Ä–µ –∏ –∫–∞–∂–¥—ã–π —Å–∏–º—Ñ–æ–ª –ø–µ—Ä—Å–æ–Ω–∞–∂–∞ –¥–∞–µ—Ç —ç–Ω–Ω—É—é —Å—É–º–º—É, —Ç–æ–∂–µ —Ä–∞–Ω–¥–æ–º–Ω–æ, –Ω–æ –Ω–∞–∏–±–æ–ª—å—à–∏–π –≤—ã–∏–≥—Ä—ã—à –¥–∞–µ—Ç —Å–∏–º–≤–æ–ª —Å–∞–º–æ–≥–æ —Ä–æ–±–æ—Ç–∞ —Ç-1000, –º–Ω–µ –Ω–∞–ø—Ä–∏–º–µ—Ä —ç—Ç–æ—Ç —Å–∏–º–≤–æ–ª –¥–∞–≤–∞–ª 100—Ö –æ—Ç —Å—Ç–∞–≤–∫–∏, —Ç–∞–∫ –∂–µ –æ—Ç–º–µ—á—É —á—Ç–æ –ø—Ä–∏—Å—É—Ç—Å—Ç–≤—É–µ—Ç —Ç—É—Ç –∏ —Ç–∞–∫–∞—è –ø—Ä–∏—è—Ç–Ω–æ—Å—Ç—å –∫–∞–∫ —Å–∫–∞–π—Ç–µ—Ä.–µ—Å–ª–∏ –æ–Ω –≤–∞–º –ø–æ–ø–∞–ª—Å—è –≤ —Ä–µ–∂–∏–º–µ —Ä–∞—Å–Ω–æ–≥–æ –≥–ª–∞–∑–∞(–∫–∞–∫ —è –Ω–∞–∑—ã–≤–∞—é —ç—Ç–æ—Ç –º–æ–¥) —Ç–æ –≤—ã –≤—ã–∏–≥—Ä–∞–ª–∏ —Ñ—Ä–∏ —Å–ø–∏–Ω—ã, –Ω–µ —Å—á–∏—Ç–∞—è –æ–±—â–µ–≥–æ –≤—ã–∏–≥—Ä—ã—à–∞, –≤ –¥–∞–Ω–Ω–æ–º —Å–ª–æ—Ç–µ –º–Ω–æ–π –±—ã–ª –≤—ã–∏–≥—Ä–∞–Ω–æ –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ —É–º–Ω–æ–∂–µ–Ω–∏–µ 1000—Ö]]></description>
			<content:encoded><![CDATA[<p>–ò—Ç–∞–∫ —ç—Ç–æ, –º–æ–π –Ω–∞–∏–ª—é–±–∏–º–µ–π—à–∏–π —Å–ª–æ—Ç –∏–∑ –≤—Å–µ—Ö –≤–æ–æ–±—â–µ, –≤ –¥–∞–Ω–Ω–æ–º —Å–ª–æ—Ç–µ, —è –≤—ã–∏–≥—Ä–∞–ª –Ω–∞–∏–≤–µ—Å–æ–º–µ–π—à—É—é —Å—É–º–º—É –∏–∑ –≤—Å–µ—Ö —Å–≤–æ–∏—Ö –∏–≥—Ä–æ–≤—ã—Ö —Å–µ—Å—Å–∏–π –≤ –æ–Ω–ª–∞–π–Ω –∫–∞–∑–∏–Ω–æ, –Ω–∞—á–Ω—É —Å —Ç–æ–≥–æ —á—Ç–æ –≤–∫—Ä–∞—Ç—Ü–µ –æ–ø–∏—à—É –¥–∞–Ω–Ω—ã–π —Å–ª–æ—Ç, —Å–ª–æ—Ç –∏–º–µ–µ—Ç 243 –ª–∏–Ω–∏–∏ –±–æ–Ω—É—Å–Ω—É—é –∏–≥—Ä—É —É–≤–µ–ª–∏—á–∏–≤–∞—é—â—é—é –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –ª–∏–Ω–∏–π –¥–æ 2048 –Ω–æ –∏–º–µ—é—â—é—é –æ–≥—Ä–æ–º–Ω—ã–π –º–∏–Ω—É—Å, –≤ –Ω–µ–π –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –ø–æ–ª—É—á–∏—Ç—å —Ä–µ—Ç—Ä–∏–≥–µ—Ä, –Ω–æ –µ—Å—Ç—å –≤ –¥–∞–Ω–Ω–æ–π –±–æ–Ω—É—Å–∫–µ —Ñ—É–Ω–∫—Ü–∏—è, –Ω–∞–∑—ã–≤–∞—é—â–∞—è—è—Å—è —Ö–æ—Ç –º–æ–¥ –≤—ã–ø–∞–¥–∞—é—â—é—é —Ä–∞–Ω–¥–æ–º–Ω–æ, —Ç–∞–∫ –∂–µ —Å—Ç–æ–∏—Ç –æ—Ç–º–µ—Ç–∏—Ç—å —Ñ—É–Ω–∫—Ü–∏—é –∫–æ—Ç–æ—Ä–∞—è –Ω–∞–∑—ã–≤–∞–µ—Ç—Å—è —Ç-1000 –≤–∏–∂–Ω, –æ–Ω–∞ —Ç–∞–∫ –∂–µ –∑–∞–ø—É—Å–∫–∞–µ—Ç—Å—è —Ä–∞–Ω–¥–æ–º–Ω–æ, –≤ –æ–±—ã—á–Ω–æ–π –∏–≥—Ä–µ –∏ –∫–∞–∂–¥—ã–π —Å–∏–º—Ñ–æ–ª –ø–µ—Ä—Å–æ–Ω–∞–∂–∞ –¥–∞–µ—Ç —ç–Ω–Ω—É—é —Å—É–º–º—É, —Ç–æ–∂–µ —Ä–∞–Ω–¥–æ–º–Ω–æ, –Ω–æ –Ω–∞–∏–±–æ–ª—å—à–∏–π –≤—ã–∏–≥—Ä—ã—à –¥–∞–µ—Ç —Å–∏–º–≤–æ–ª —Å–∞–º–æ–≥–æ —Ä–æ–±–æ—Ç–∞ —Ç-1000, –º–Ω–µ –Ω–∞–ø—Ä–∏–º–µ—Ä —ç—Ç–æ—Ç —Å–∏–º–≤–æ–ª –¥–∞–≤–∞–ª 100—Ö –æ—Ç —Å—Ç–∞–≤–∫–∏, —Ç–∞–∫ –∂–µ –æ—Ç–º–µ—á—É —á—Ç–æ –ø—Ä–∏—Å—É—Ç—Å—Ç–≤—É–µ—Ç —Ç—É—Ç –∏ —Ç–∞–∫–∞—è –ø—Ä–∏—è—Ç–Ω–æ—Å—Ç—å –∫–∞–∫ —Å–∫–∞–π—Ç–µ—Ä.–µ—Å–ª–∏ –æ–Ω –≤–∞–º –ø–æ–ø–∞–ª—Å—è –≤ —Ä–µ–∂–∏–º–µ —Ä–∞—Å–Ω–æ–≥–æ –≥–ª–∞–∑–∞(–∫–∞–∫ —è –Ω–∞–∑—ã–≤–∞—é —ç—Ç–æ—Ç –º–æ–¥) —Ç–æ –≤—ã –≤—ã–∏–≥—Ä–∞–ª–∏ —Ñ—Ä–∏ —Å–ø–∏–Ω—ã, –Ω–µ —Å—á–∏—Ç–∞—è –æ–±—â–µ–≥–æ –≤—ã–∏–≥—Ä—ã—à–∞, –≤ –¥–∞–Ω–Ω–æ–º —Å–ª–æ—Ç–µ –º–Ω–æ–π –±—ã–ª –≤—ã–∏–≥—Ä–∞–Ω–æ –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ —É–º–Ω–æ–∂–µ–Ω–∏–µ 1000—Ö</p>
]]></content:encoded>
		
